import { useState, useEffect } from 'react';
import { TreeTable } from 'primereact/treetable';
import { Column } from 'primereact/column';
import { params } from './params';

export default function FullParameterList({ param_type }) {
    const [nodes, setNodes] = useState([]);

    // Flatten data structure for TreeTable
    const flattenData = (data) => {
        return data.map(item => ({
            ...item,
            children: item.children.length ? flattenData(item.children) : null, // Recursive call for nested children
            size: item.data, // Assuming 'data' represents the size
            type: typeof item.data // Assuming 'data' is the value you want to display as type
        }));
    };

    useEffect(() => {
        const data = params.getFullParams();
        setNodes(flattenData(data));
    }, []);

    useEffect(() => {
        console.log('data', nodes);
    }, [nodes]);

    return (
        <div className="card">
            <TreeTable value={nodes} tableStyle={{ minWidth: '50rem' }}>
                <Column field="label" header="Name" expander></Column>
                <Column field="size" header="Size"></Column>
                <Column field="type" header="Type"></Column>
            </TreeTable>
        </div>
    );
}
